      "title":"journey.  leather feather earrings \/\/ boho, tribal, bohemian, feathers",
      "description":"Long beautiful feather earrings made with love. \r\nYour choice of stone with layers of deerskin lace and beautiful grizzly, peacock and rooster feathers.\u2665 \r\n\r\n** Deerskin colors\r\n~Brown\r\n~Cream\r\n~Black\r\n\r\n**Stone Choices\r\n~Turqouise\r\n~Jade\r\n~Peridot\r\n~Labradorite\r\n\r\nThese earrings measure about 10 inches in length from the top of the turquoise.\r\n\r\nTurquoise is  a valued power stone. It will strengthen and align all of the Chakras; and it can be used to cleanse your energy centers. As a meditation tool, the gem can assist in clearing your mind, opening you to the Universal All. Use Turquoise to attune to the spiritual plane or provide protection during vision quests or astral travel.\r\n\r\nNative Americans believed the stone brought protection to a rider upon a horse, and great protection in general, especially to turn away the evil eye.\r\n\r\nCalled &quot;sky stone&quot; or &quot;stone of heaven&quot; by some Native Americans, the vibrations of turquoise can build a spiritual bridge between worlds and give strong psychic powers to the bearer.\r\n\r\nTurquoise is considered to be a symbol of generosity, sincerity, and affection. It preserves friendships and can make friends out of enemies in time. Traditionally is is said to only bring good luck if given, not purchased. However, this is not always the case. One must take into consideration the innate energy of each stone individually.\r\n\r\nSHOP POLICIES~\r\nWelcome to Spirit Tribe. All my pieces are handmade with love, creativity and good vibes...I am inspired by the elements, the earth and spirit. I hope you find something you love. Please like my page to get the latest creations, deals, and coupon codes. I am happy to make custom pieces, please message me with what you want.\r\n\r\nI accept credit cards and paypal.\r\n\r\nI use as much recycled material in shipping as possible & I choose to support small businesses.\r\n\r\nPlease allow up to two weeks for your order to be processed and shipped, although I try my best to have orders out within a couple days. \r\n\r\nI offer tracking numbers for U.S residents. If you are outside of the U.S and want a tracking number please message me. International orders have an estimated arrival time of 1-3 weeks, depending on customs.\r\n\r\n\r\nI want you to be 100% satisfied with your order. If you are completely unhappy with your order I am happy to exchange it for you for equal or more value and but you must pay the difference if it is higher value exchange.\r\nI must be notified within 30 days of the item being recieved for exchange.\r\nI do not issue refunds.",
