      "title":"Boho Hippie Orange Sunflower Crochet Shoulder Warmer Poncho Shawl",
      "description":"You can tell I love retro colors can&#39;t you? There&#39;s something about a happy orange and yellow sunflower combination that makes me smile.\r\n\r\nThis very cool open work crochet shoulder warmer is perfect for cool days in the warmer months and ideal for the colder months as an accent piece over a sweater or blouse (a black turtleneck under it would be bold and stunning!).\r\n\r\nAlthough lightweight and open weave, this shoulder warm has a soft cozy feel like a friendly hug. Bright pumpkin orange with sunshine yellow and coco brown sunflower hand sewn securely with embroidery thread. Wear the flower to the right or left and off on shoulder if you&#39;re feeling extra sassy. The possibilities are what make this piece a must have.\r\n\r\n*This can also be CUSTOM MADE in the colors of your choice. Just convo me.\r\n\r\nSize is free as it is worn over the head to rest on the shoulders. Here are the measurements:\r\n\r\nTop edge&quot; 36&quot; around\r\nBottom edge: 56&quot; around\r\nLength: 9&quot; from top to edge of loop ruffle\r\n\r\nMade from durable 100% acrylic yarn for easy care.\r\nMachine wash in cold and dry on low heat. Yarn will soften when washed and dried by machine. Fold to store to keep from stretching.",
