      "user_id":16525085,
      "category_id":68905726,
      "title":"Retro, Mod, Pierced Earrings",
      "description":"Think Liverpool or London in the 70&#39;s, Twiggy, The Avengers & Emma Peel, Andy Warhol, happy, playful, sly. These earring bouquets are from the exciting 60s & 70s. The center of the black plastic flowers are a nice quality crystal outlined in a warm, brassy shade of gold. I converted them from screw backs to wires and they are actually lighter than you would think and they are in perfect condition. \r\n\r\nApocalypse Jewelry\r\n\r\nMy jewelry has been collected from many sources over the years and is assembled from new, vintage and antique parts, it will show some wear and age. That\u2019s the fun of reusing, upcycling and reconstructing. The finished creation will be a one and only piece. I wear each piece for a day to be sure it is comfortable and secure. The clasps are oversized for easy on and off. My home and studio are non smoking but I share my home with a cat or two.\r\n\r\nAs an avid environmentalist and animal advocate, I feel that the reuse, recycling and repurposing of materials in my jewelry and accessories is a socially conscious fashion statement. All my creations are 100% vegan so, enjoy, and respect the earth and its creatures at the same time.\r\n\r\nEach item is mailed to you in a gift box made from recycled paper, tied with decorative ribbon, packed in cotton, inside a padded envelope. If you desire, I will gladly gift wrap the box and mail it to the recipient of your choice and include a small gift card with your message inside. We can plan it all by email in an Etsy \u201cconvo\u201d, on the shipping section.\r\n\r\nPayment- in US dollars only thru Paypal\r\nShipping- I will mail within three days of your order, USPS..\r\nOnce the package leaves my hands it is also out of my control. I will be able to show a certificate of mailing from USPS but if you would like insurance I will get a price from USPS and notify you of the cost. \r\n\r\nIn my quest for jewelry parts I often find vintage or antique jewelry that is intact so rather than taking it apart, I sell them as is.  That way the past lives on and when you wear them, you are wearing a bit of history and mystery.\r\nI hope you will enjoy my jewelry as much as I enjoyed finding or making it.",
