      "title":"Felicificative Frog (Psychedelic Spiritual Mandala Haloed Red-Eyed Tree Frog Drawing in Orange and Yellow Copic Marker and Gold Paint)",
      "description":"This is an 8 by 10 print of Felicificative Frog, drawn with high quality professional copic markers and ink on eco-friendly wind-power bristol board. For a significantly lower price than purchasing an original, you can own a limited edition, signed, numbered mini-print of the Frog.\r\n\r\nThis Frog was originally created as part of my &quot;Livid Vivid Living&quot; Series. It is a multicolored red-eyed rainforrest frog perched delicately on a geometric plant. He is crowned by a golden radiating mandala of shimmering light and pattern. I wanted to show my reverence for the natural world and the connection and majesty between all living things. I created the frog with vibrant psychedelic colors on a warm orangey sundrenched background. When I drew it I created bold multicolored splashes of ink across the drawing. I find these Amazonian frogs intoxicatingly beautiful. The word &quot;felicificative&quot; comes from Latin and means &quot;happiness-making.&quot; And I hope this frog will make you as happy as it has made me. \r\n\r\nThis print is great for frog-lovers and crazed amphibian fans, as well as lovers of color and animals and life. It may print slightly darker than printed above. Also, there are white margins on the edges for easier framing, though no frame is included. Will look great framed or just tacked up on the wall. This print is small but packs a big punch of color. As always, my packaging is 100 percent recycled and 100 percent recyclable. Thanks so much for looking and have a groovy day!",
